import React from "react";
import Card from './Card';
import "./index.css";
import carddata from "./data";


function App() {
    return (
        <>
            <div className="header">
                <h1>List of top 3 series</h1>
            </div>
            <div className="cards">
                {carddata.map((cardItem,idx)=>{
                    return (<Card
                        imgsrc={cardItem[idx]?.imgsrc}
                        toptext={cardItem[idx]?.toptext}
                        title={cardItem[idx]?.title}
                        link={cardItem[idx]?.link}
                    />)
                })}

            </div>
        </>

    );
}

export default App;
